import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import ShowPhotos from './ShowPhotos'; // Modifica esta línea
import CreatePhoto from './CreatePhoto'; // Modifica esta línea

const AppRouter = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path="/" component={ShowPhotos} />
          <Route exact path="/create-photo" component={CreatePhoto} />
        </Switch>
      </div>
    </Router>
  );
};

export default AppRouter;
